describe("3-hero service (http) integration testing:", () => {
    let heroComponent:HeroServiceForLab,http!:HttpClient;
    heroComponent = new HeroServiceForLab(http);
    it("getHeroes function: send request and receive response successfully", () => {
        isObservable()
        expect(heroComponent.getHeroes())
     });
